import React, { Component } from "react";
import "./Days.css";
class Days extends Component {
  state = {};
  render() {
    return (
      <div className="mainBox">
        <div className="weatherBox">
          <h3>{this.props.dayName}</h3>
          <p>{this.props.date}</p>
        </div>
      </div>
    );
  }
}

export default Days;
